import React from 'react';
import Navbar from '../components/Navbar';
import Heroimage from '../components/Heroimage';
import Footer from '../components/Footer';

const Home = () => {
  return (
    <div>
      <Navbar/>
      <Heroimage />
      <Footer />
    </div>
  );
};

export default Home;
